(32, 1, '2018-10-12 21:09:58', '2018-10-12 21:09:58', '<p>Part of the Omnex Group, Sharemoney has specialized in money transfers for more than 25 years. Transferring money is easy, whether you’re taking care of foreign relatives or topping up your BFF’s kayaking emergency fund.</p>\n<p>With competitive fees and rates along with a simple, fast service, it’s worth keeping Sharemoney in mind for unexpected family emergencies. Rates are updated daily, and you’ll see clear fees and exchange rates before you finish your transfer.</p>\n<p>Supporting your loved ones abroad is easy, because signing up for an account means that once you’ve paid someone, you can repeat the transaction with three clicks. Users report fast delivery times and easy pickups — and Sharemoney can even text you when your money’s arrived.</p>\n<p>Sharemoney doesn’t cover all locations, but it’s adding new territories, so confirm that your money can get where it needs to.</p>\n\n<!-- wp:image {\"id\":69} -->\n<figure class=\"wp-block-image\"><img src=\"http://localhost:1111/workspace/walk/wordpress/wp-content/uploads/2018/10/growing-rate.jpg\" alt=\"\" class=\"wp-image-69\"/></figure>\n<!-- /wp:image -->', 'Financial analysis', '', 'publish', 'open', 'open', '', 'mbluclugclufcklufclkurd', '', '', '2018-10-18 19:19:43', '2018-10-18 19:19:43', '', 0, 'http://localhost:1111/workspace/walk/wordpress/?p=32', 0, 'post', '', 0),
