(88, 1, '2018-10-18 19:40:34', '2018-10-18 19:40:34', '<!-- wp:paragraph -->\n<p>The insurer reported quarterly profit of $2.54 per share, beating the consensus estimate of $2.26 a share. Revenue also topped Wall Street forecasts. Travelers saw growth in both personal and business insurance, as well as strong retention numbers.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":87,\"width\":382,\"height\":334} -->\n<figure class=\"wp-block-image is-resized\"><img src=\"http://localhost:1111/workspace/walk/wordpress/wp-content/uploads/2018/10/financial-graph2.jpg\" alt=\"\" class=\"wp-image-87\" width=\"382\" height=\"334\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p><a href=\"https://www.cnbc.com/quotes/?symbol=BX\">Blackstone</a> – The private-equity firm\'s economic net income beat Street forecasts by 2 cents a share at 76 cents per share, while revenue was above estimates, as well. Assets under management surged 18 percent from a year ago to a record $457 billion.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><a href=\"https://www.cnbc.com/quotes/?symbol=BK\">Bank of New York Mellon</a> – The bank beat estimates by 2 cents a share, with quarterly earnings of $1.06 per share. Revenue was below Street projections. The company characterized its revenue growth as only \"modest\" but added that it is confident it can boost revenue performance.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><a href=\"https://www.cnbc.com/quotes/?symbol=DHR\">Danaher</a> – The science and medical technology company beat estimates by 2 cents a share, with adjusted quarterly earnings of $1.10 per share. Revenue also came in above forecasts and Danaher raised its full-year forecast.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><a href=\"https://www.cnbc.com/quotes/?symbol=TXT\">Textron</a> – The aircraft and defense systems maker <a href=\"https://www.cnbc.com/2018/10/18/textron-profit-misses-on-lower-aircraft-sales.html\">reported adjusted profit of 61 cents per share</a>, falling short of the 76 cents a share consensus estimate. Revenue also missed forecasts, on declines in its industrial and systems businesses. Textron gave forward guidance that falls below analysts\' forecasts.</p>\n<!-- /wp:paragraph -->', 'Stocks making the biggest move', '', 'inherit', 'closed', 'closed', '', '86-revision-v1', '', '', '2018-10-18 19:40:34', '2018-10-18 19:40:34', '', 86, 'http://localhost:1111/workspace/walk/wordpress/2018/10/18/86-revision-v1/', 0, 'revision', '', 0);
